text:
yes! if only more people got it right the way #osmankhalidbutt does. #metoo cannot be disregarded as a tool being used to spread lies and false accusations. abuse is a reality, it needs to be taken seriously and when one after the other, more and more women speak out, share stories, offer support, when more and more stories come out against a single perpetrator, then we need to stop excusing them away as attention-seekers. we need to take action rather than continue to laud abusers as heroes, declaring them to merely have been ‘wronged’.
gender-sensitivity training really is needed.
@aclockworkobi 👏👏👏

